import { Border } from "./style";

const SquareVisualizer = ({ data }) => {
  return (
    <>
      {data.map((thumbnail) => {
        return (
          <>
            <div className="container">
              <Border>
                <img src={thumbnail.thumbnail} alt="fuck" />
                <p>{thumbnail.autore}</p>
                <h4>{thumbnail.titolo}</h4>
              </Border>
            </div>
          </>
        );
      })}
    </>
  );
};

export default SquareVisualizer;
